// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import HomePage from './Homepage';
import BMICalculator from './BMICalculator';
import Tracker from './Tracker';
import FitnessSuggestions from './FitnessSuggestions';
import FunctionButtons from './FunctionButtons';
import './App.css';

function App() {
  const handleBMIClick = () => {
    window.location.href = '/bmi-calculator'; // Navigate to BMI Calculator
  };

  const handleTrackerClick = () => {
    window.location.href = '/tracker'; // Navigate to Tracker
  };

  const handleFitnessClick = () => {
    window.location.href = '/fitness-suggestions'; // Navigate to Fitness Suggestions
  };

  return (
    <Router>
      <div className="app-container">
        <nav>
          <Link to="/">Home</Link> | 
          <Link to="/bmi-calculator">BMI Calculator</Link> | 
          <Link to="/tracker">Tracker</Link> | 
          <Link to="/fitness-suggestions">Fitness Suggestions</Link>
        </nav>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/bmi-calculator" element={<BMICalculator />} />
          <Route path="/tracker" element={<Tracker />} />
          <Route path="/fitness-suggestions" element={<FitnessSuggestions />} />
        </Routes>
        <FunctionButtons 
          onBMIClick={handleBMIClick}
          onTrackerClick={handleTrackerClick}
          onFitnessClick={handleFitnessClick}
        />
      </div>
    </Router>
  );
}

export default App;
